
------ create table dmbd --------

CREATE TABLE ms_dmbd
(
  id numeric(25) NOT NULL,
  ma character varying(25),
  ten character varying(100),
  tyle1 character varying(5),
  tyle2 character varying(5),
  dang character varying(50),
  tenhc character varying(200),
  sodk character varying(100),
  gianhap numeric(10,3) DEFAULT 0,
  giaban numeric(10,3) DEFAULT 0,
  duongdung character varying(100),
  tenhom character varying(100),
  tenloai character varying(100),
  tenhang character varying(100),
  tennuoc character varying(100),
  stt serial NOT NULL,
  CONSTRAINT pri_constraint PRIMARY KEY (id)
)
WITH (
  OIDS=FALSE
);
ALTER TABLE ms_dmbd OWNER TO enterprisedb;


